import React from 'react'

var stylingObject = {
    container: {
        display: "flex",
        width: "100%",
        height: "500px",
        background: "red",
        justifyContent: "center",
        alignItems: "center"
    }
}

function Hero() {
    return (
        <div style = {stylingObject.container}>
            <div style = {stylingObject.textContainer}>
                <h1>Header</h1>
                <h3>Subheader</h3>
            </div>
            <div style = {stylingObject.imageContainer}>
                <image src='ChefImage.png' width="400px" height="400px"></image>
            </div>
        </div>
    )
}

export default Hero
